import React from 'react';
import '../style.css';

export default class Results extends React.Component {

    render() {
        if (this.props.data !== undefined) {
        return (
            <div className="render">
                <p className="temperature">Température : {this.props.data.temp}</p>
                <p className="temp_max">Température max : {this.props.data.temp_max}</p>
                <p className="temp_min">Température mini : {this.props.data.temp_min}</p>
                <p className="humidity">Humidité : {this.props.data.humidity}</p>
                <p className="pressure">Pression : {this.props.data.pressure}</p>
                <p className="description">Description : {this.props.data.description}</p>
            </div>
        );
        } else {
            return false;
        }
    }
}
